import React from 'react';
import styled from 'styled-components';

const Item = (props) => {
  const onClick = (e) => {
    console.log(`클릭`);
  };
  return (
    <li>
      <dl>
        <BookImage src={props.thumbnail}>
          <img alt={props.thumbnail} onClick={onClick} />
        </BookImage>
      </dl>
      <dd>
        <h3>{props.title}</h3>
        <p>{props.authors}</p>
        <p>{props.price}</p>
        <p>{props.publisher}</p>
      </dd>
    </li>
  );
};
const BookImage = styled.a``;

export default Item;
